import React from 'react';
import {StylesProvider} from '@material-ui/styles';
import {CssBaseLine } from  '@material-ui/core';
import {GlobalStyle} from './utilitiesStyles/styles/global-Styles.js'

function App() {
  return (
    <StylesProvider injectFirst>
      <CssBaseLine />
      <GlobalStyle />
      <div>
        Teste
      </div>
    </StylesProvider>
  );
};

export default App;
